import React from "react";
import styled from "styled-components";

const Main = styled.div`
  display: flex;
  flex-direction: row;
  width: 100%;
  min-height: 100%;
  align-items: center;
  margin: 0;
  padding: 0;
`;

const LeftContainer = styled.div`
  background: red;
  width: 40px;
`;

const RightContainer = styled.div`
  background: blue;
  width: 40px;
`;

function SignupPage() {
  return (
    <Main>
      <LeftContainer />
      <RightContainer />
    </Main>
  );
}

export default SignupPage;
